        // Decode and create images
        base64DataArray.forEach(function(base64Data) {
            var img = document.createElement('img');
            img.src = 'data:image/png;base64,' + base64Data;
            document.getElementById('image-container').appendChild(img);
            img.onload = function() {
                createHTMLFromImage(this);
            };
        });

        // Function to create HTML elements from an image
        function createHTMLFromImage(img) {
            var canvas = document.createElement('canvas');
            var context = canvas.getContext('2d');
            context.drawImage(img, 0, 0);
            var imageData = context.getImageData(0, 0, img.width, img.height);

            // Loop through the image data to identify elements
            for (var i = 0; i < imageData.data.length; i += 4) {
                var red = imageData.data[i];
                var green = imageData.data[i + 1];
                var blue = imageData.data[i + 2];
                var alpha = imageData.data[i + 3];
                // Based on color values, create corresponding HTML elements
                if (red === 255 && green === 0 && blue === 0) {
                    // Red pixel detected, create a <div> element for example
                    var div = document.createElement('div');
                    div.style.width = '100px';
                    div.style.height = '100px';
                    div.style.backgroundColor = 'red';
                    document.body.appendChild(div);
                }
